nel blocker (CCB) to you if you are starting step 1 high blood pressure treatment, are 55 or older and do not have type 2 diabetes, or at any age if you have black Africian or African-Caribbean family origin and do not have type 2 diabetes.", "is_bookmarked": true}]	1	1
