eatment if your blood pressure is stable and well controlled on bedroflumethiazide or hydrochlorothiazide.", "is_bookmarked": false}, {"rating": 0.0, "prompt_id": "prompt_9", "prompt_text": "Before your doctor considers step 2 high blood pressure treatment, they will discuss with you if you are taking your medications as directed.", "is_bookmarked": false}, {"rating": 3.0, "prompt_id": "prompt_10", "prompt_text": "If your blood pressure is still high after being on step 1 treatment with an an angiotensin converting enzyme (ACE) or angiotensin receptor blocker (ARB) medication, your doctor will offer first a calcium-channel blocker (CCB) or a thiazide-like-diuretic medication.", "is_bookmarked": false}, {"rating": 0.0, "prompt_id": "prompt_11", "prompt_text": "If your step 1 high blood pressure medication plan included a CCB and your blood pressure is not controlled, your doctor will, in addition to step 1 medications, offer an ACE, ARB, or thiazide-like diuretic", "is_bookmarked": true}, {"rating": 0.0, "prompt_id": "prompt_12", "prompt_text": "For adults who are black African or African-Caribbean who do not have type 2 diabetes and are on step 1 medication therapy, your doctor may consider starting you on an ARB or ACE along with your step 1 medication treatment.", "is_bookmarked": false}]	1	1
