41	a1189deb-2604-4a09-a6d3-9110faf308a9	2025-10-14 14:56:20.051033+00	2025-10-14 14:56:20.051045+00	Medicaid; Medicare; Outpatients; Insurance; Health; Hospitals; Delivery of Health Care; Government; Health System	What is the Traditional U.S. Healthcare system?	t	0	\N	\N	The majority of healthcare services in the U.S. are provided through public, academic, and private healthcare facilities. Healthcare services are typically paid for by government insurance such as Medicare and Medicaid, or commercial insurance plans provided by employers or purchased by individuals.  These insurances cover  a wide range of services including hospital based procedures and admissions, to outpatient office visits, and residential care in one's own home. Individuals without health insurance are billed and pay for healthcare services.  Certain emergency services are required to be provided by law regardless of insurance or ability to pay.	Traditional U.S. Health Care
42	797015be-fb1d-450d-bf7b-7246b036de88	2025-10-14 14:56:20.052481+00	2025-10-14 14:56:20.052491+00	Military Personnel; Veterans Affairs; Outpatients; Mental Health; Health Services; Hospitals; Delivery of Health Care; Substance-Related Disorders; Insurance; Veterans	What is the Veterans Administration?	t	0	\N	\N	Veterans Administration (VA) provides health services to active duty, disabled, and retired service connected military personnel and in certain cases, their families.  Military personnel and eligible family members are covered through medical insurance programs known as TRICARE or CHAMPVA. The VA has a large network of healthcare services through medical centers (hospital based) and outpatient healthcare services. Covered healthcare services include hospital, outpatient, surgical, mental health, preventative, and substance abuse.	Veterans Administration
43	55cb521a-3361-4d21-819a-8aaa8b9ced45	2025-10-14 14:56:20.053081+00	2025-10-14 14:56:20.05309+00	Alaska Natives; Indian Health Service; American Indian; Alaska Native; Hospitals; Delivery of Health Care; Ambulatory Care	What is Indian Health Services?	t	0	\N	\N	Indian Health Services provides government based health services to American Indians and Alaskan Natives. Others may qualify for under certain circumstances. Indian Healthcare Services include  hospital care, local healthcare centers (outpatient services), behavioral health, dental, pharmacy, imaging, and laboratory services.	Indian Health Services
44	ca488ad2-4cb0-4078-acc4-e7179650d689	2025-10-14 14:56:20.053566+00	2025-10-14 14:56:20.054065+00	Physicians; Health Facilities; Nurse Practitioners; Physician Assistants; Primary; Health Care	What is Primary Care?	t	0	\N	\N	Provided locally in your home, residence, or at a doctor's office by a doctor or provider such as a physician assistant (PA) or nurse practitioner (NP). Your primary care provider (PCP) is the doctor or other licensed provider who is responsible for managing and coordinating all of your health needs.	Primary Care
45	cd9f9078-851e-4094-bb03-a128140fb353	2025-10-14 14:56:20.054528+00	2025-10-14 14:56:20.054535+00	Ambulatory Care; Urgent Care; Urgent; Minute Care; Outpatient Health Services;\nOutpatient Care; Outpatient Services; Outpatient Health;	What is Urgent Care or Minute Care?	t	0	\N	\N	Urgent and minute care clinics provide non-emergent care with the convenience of walk-in appointments and extended hours. Urgent and minute cares, are a great option for when you are not able to see your doctor soon enough or you have significant health issues. Many urgent and minute clinics provide primary care services as well. Routine, urgent, or non-emergent health care issues can often be addressed at urgent or minute clinics.	Urgent or Minute Care
46	8c1e1d05-c5f9-4417-8696-c61408f2b480	2025-10-14 14:56:20.055291+00	2025-10-14 14:56:20.055298+00	Patient Discharge; Nurse Practitioners; Hospitals; Emergency Service; Emergency Hospital; Emergency; Physician Assistants	What is Emergency Care?	t	0	\N	\N	Emergency services are provided in a free standing or more often in a hospital's Emergency Department. Services are provided by providers such as doctors, physician assistant (PA) or nurse practitioner (NP). There are other staff such as registered nurses and various technicians. Emergency services aim to treat, stabilize, discharge, or if needed admit or transfer to a hospital for continued medical care. Emergency departments are not all the same. Some are able to provide typical emergency services, while others provide a wide range of specialized services such as burns, trauma, stroke, heart conditions, and more.	Emergency Care
47	01871173-8737-4ec6-90a5-695cef24f9ba	2025-10-14 14:56:20.055768+00	2025-10-14 14:56:20.055775+00	Outpatients; Ambulatory Care; Clinic Visits; Outpatient Health Services;\nOutpatient Care; Outpatient Services; Outpatient Health; Urgent Care	What is Outpatient and Ambulatory Care?	t	0	\N	\N	Care, services, procedures, or tests that do not require a hospital admission and take place at inside or outside of hospitals at various medical centers. Individuals may be observed for a short period, but typically go home afterwards. A few examples of outpatient services include specialist consultation, minor surgical procedures, diagnostics, treatments, or rehabilitation.	Outpatient and Ambulatory Care
48	31a28dce-7f52-4ccf-829b-64484b202fab	2025-10-14 14:56:20.056237+00	2025-10-14 14:56:20.056245+00	Hospitals; Hospital Services; Acute Care; Immediate Care; Inpatient	What is Hospital or Acute Care?	t	0	\N	\N	Provide hospital or acute (immediate) care to individuals for severe illness, health problems or injuries like a car accident. Services are provided by licensed doctors and specialists, nurse practitioners (NP), physician assistants (PA), nurses, therapists, pharmacists, radiologist, dieticians, social workers, as well as many other unlicensed staff. Individuals may require hospital services for a couple of days or longer periods in complex, life-threatening situations.	Hospital or Acute Care
49	b1991c8d-7797-41fd-9e86-6847689769d7	2025-10-14 14:56:20.056731+00	2025-10-14 14:56:20.056738+00	LTAC; Long Term Care; Longterm; Hospital	What is Long Term acute care Hospitals (LTAC)?	t	0	\N	\N	Services are provided for individuals that no longer require hospital care but require further care which is more care than can be provided in the home or residential facility. Individuals need to meet criteria for current care needs and have certain types of insurance to qualify. Individuals admitted to long term acute care hospitals (LTAC) usually need at least 21 days or more of care and services.	Long Term acute care Hospitals (LTAC)
50	f51026bb-ab35-47be-837c-2787fca95e95	2025-10-14 14:56:20.057189+00	2025-10-14 14:56:20.057214+00	Rehab; Rehabilitation Services; Sub-acute; Skilled nursing; SAR; SNF; Facility	What is Rehabilitation Facility Care?	t	0	\N	\N	Rehabilitation services provided at an Inpatient rehabilitation (IPR) center usually located within a hospital or other rehabilitation centers located in the community known as sub-acute rehabilitation (SAR) at a skilled nursing facility (SNF) or specialty rehabilitation center. IPR provide the highest and most intense level of rehab services followed specialty rehabilitation centers and SAR at a SNF.	Rehabilitation Facility Care
51	ff439381-e996-4b1e-ad6c-e8c06958f73b	2025-10-14 14:56:20.057679+00	2025-10-14 14:56:20.057686+00	Home Care Services;\nDomiciliary Care;\nHome Care;\nHome Health Care;\nHome Health; Residential; Care Services	What is a Residential and Home Based Care?	t	0	\N	\N	Care is provided in your home or residence. This could be a house, apartment, shelter, adult foster care (AFC) or group home, senior apartment, assisted living facility. Some people live at and get long term care at a skilled nursing facility. Healthcare providers like doctors, physician assistants (PA), and nurse practitioners (NP) may visit you in your residence. They may provide routine care or complex care. Other skilled services such as home care skilled nursing, physical, occupational, and speech language therapy, social work, and home health aid can be provided at your residence. Palliative and hospice care can also be provided at residential and home-based locations. Palliative care focuses on treatment of your symptoms and the focus is on quality of life and less on treatment of health problems.	Residential and Home Based Care
52	c9a3a5ff-37ee-461c-bac3-c2d81fc52f75	2025-10-14 14:56:20.058213+00	2025-10-14 14:56:20.05822+00	Mobile Health;\nTele-Care;\nTelecare;\nTelehealth;\nVirtual Medicine;\neHealth;\nmHealth	What is Telehealth?	t	0	\N	\N	Care provided through use of a smartphone, tablet, or computer. The licensed doctor, nurse practitioner (NP), physician assistant (PA), or therapists, connects to you by video. Telehealth provides easier access to healthcare providers because traveling is not necessary. Telehealth services are used for typical health conditions, follow-up appointments, or mental/behavioral health services. There are times when telehealth is not appropriate for your health need such as when your injury or illness is severe and it is better to be seen in person.	Telehealth
